import React from 'react';
import '../styles/login.css';
import {MDBContainer, MDBCol, MDBRow, MDBInput, MDBCheckbox } from 'mdb-react-ui-kit';

function Login() {

  return (
    <MDBContainer fluid className="p-3 my-5 h-custom">

      <MDBRow>

        <MDBCol col='10' md='6'>
          <img src="https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-login-form/draw2.webp" class="img-fluid" alt="Sample image" />
        </MDBCol>

        <MDBCol col='4' md='5'>

          <div className="d-flex flex-row align-items-center justify-content-center divider d-flex align-items-center my-4">
            <h1 className='myTitle'>Welcome To VMS</h1>

          </div>


          <MDBInput wrapperClass='mb-4' label='Email address' id='formControlLg' type='email' size="lg"/>
          <MDBInput wrapperClass='mb-4' label='Password' id='formControlLg' type='password' size="lg"/>

          <div className="d-flex justify-content-between mb-4">
            <MDBCheckbox name='flexCheck' value='' id='flexCheckDefault' label='Remember me' />
            <a href="!#">Forgot password?</a>
          </div>

          <div className='text-center text-md-start mt-4 pt-2'>
          <button type="button" class="btn btn-primary" aria-required>Login</button>
            <p className="small fw-bold mt-2 pt-1 mb-2" aria-required>Don't have an account? <a href="register" className="link-danger">Register</a></p>
          </div>

        </MDBCol>

      </MDBRow>




    </MDBContainer>
  );
}

export default Login;
